Rules.InvariantScript:
//Use RenameColumns function to add/edit the accordion, use title column for your header and content column for the body
Table(
    {
        title: "Request License Form",
        content: "Need to request a license for the first time? Need to upgrade or downgrade your license? This is where to go! <br> <br>

There are two different license types you can choose from - Standard or Premium Developer. 

Once your request is approved and processed, you will receive a license as well as access to your line of service POC (proof-of-concept) environment. If you need access to additional environments, it can be requested via the 'Request Access to an Existing Environment' tile. <br><br>

Please allow 1-2 business days for processing license requests."
    },
    {
        title: "Environment Creation Request Form",
        content: "If one of our existing environments do not suit your needs, you may request for a new environment via this form. At this point in time, new environment requests are only accepted when the environment is for a client engagement OR if the data classification is highly confidential. 

 <br> <br>
After you submit the request, a team member may reach out to you to collect additional details. If approved, you will become the system administrator for the stack of environments. Additional individuals needing access to the environment may request access through the Environment Access form on the home page, which will be routed to you for approval. <br><br>

If additional system administrators are needed, please use the Environment Access form to request. <br><br>

Please allow 2-3 business days for processing environment creation requests. "
    },
    {
        title: "Environment Access Form",
        content: "To request access to one of our existing environments, you may do so using this app.  <br><br> 
 
 Once you submit the form, your request will get routed to the system administrator(s) for approval. <br><br> 
 
 Note: To qualify for a System Administrator role, you MUST have a @admin.pwc.com account.   <br><br> 

 Please allow 2-3 business days for processing environment access requests.
 "
    },{
        title: "Track Requests Page",
        content: "Check the status of your toolkit requests here. You may filter through records by request type and status. "
    },{
        title: "My Profile Page",
        content: "Unsure what licenses you currently hold? Click 'My Profile' to see!"
    }
)

